import React, { useState, useEffect } from 'react';
import "./homepage.css"
import axios from 'axios'

const Homepage = ({setLoginUser, user}) => {
    const [repos, setRepos] = useState([]);

    const gitrepo = async () => {
        try{
        const result = await axios(`https://api.github.com/users/${user.gituser}/repos`)
        .then(res => {
            setRepos(res);
            console.log(res)
        })
        }catch(error){
            console.log(`https://api.github.com/users/${user.gituser}/repos`)
        }
    }
    // useEffect(() => { gitrepo();});

    return(
        <div className='homepage'>
            {console.log(user)}
            <h1>Hi {user.name}</h1>
            {/* <button onClick={gitrepo}></button> */}
            <div className='button' onClick={() => setLoginUser({})}>Logout</div>    
        </div>
    )
}

export default Homepage
